import React, { useRef, useEffect, useState } from "react";
import { Link } from "react-router-dom";
import { Button } from "@mui/material/Button";

import styles from "./Header.module.scss";
import Container from "@mui/material/Container";

import logo from "../../media/logo/logo.png";
import user from "../../media/auth-like-menu/user.png";
import like from "../../media/auth-like-menu/like.png";
import menu from "../../media/auth-like-menu/menu.png";
import tg from "../../media/socials/tg.png";
import youtube from "../../media/socials/youtube.png";
import vk from "../../media/socials/vk.png";

export const Header = () => {
    const isAuth = false;

    const onClickLogout = () => {};

    const headerRef = useRef(null); // Создаем реф для заголовка
    const [headerHeight, setHeaderHeight] = useState(0); // Состояние для хранения высоты заголовка
  
    useEffect(() => {
      // Функция для обновления высоты заголовка
      const updateHeaderHeight = () => {
        if (headerRef.current) {
          setHeaderHeight(headerRef.current.offsetHeight); // Получаем высоту заголовка
        }
      };
  
      updateHeaderHeight(); // Вызываем функцию для инициализации
      window.addEventListener("resize", updateHeaderHeight); // Обновляем высоту при изменении размера окна
  
      // Удаляем обработчик при размонтировании компонента
      return () => {
        window.removeEventListener("resize", updateHeaderHeight);
      };
    }, []);

    return (
        <header>
            <section className={styles.header_top} ref={headerRef}>
                <section className={styles.logo_nav}>
                    <img src={logo} alt="logo" />
                    <nav>
                        <a href="#">Проекты</a>
                        <a href="#">Поиск квартир</a>
                        <a href="#">Способы покупки</a>
                        <a href="#">Контакты</a>
                        <a href="#">Тур</a>
                    </nav>
                </section>
                <section className={styles.header_inf}>
                    <div className={styles.city_tel}>
                        <div className={styles.choose_city}>Казань</div>
                        <div className={styles.tel}>
                            <a href="#">+7 843 207-19-80</a>
                            <a href="#">Заказать звонок</a>
                        </div>
                    </div>
                    <div className={styles.auth_like_menu}>
                        <a href="#">
                            <img src={user} alt="" />
                        </a>
                        <a href="#">
                            <img src={like} alt="" />
                        </a>
                        <div className={styles.menu}>
                            <a href="#">
                                <img src={menu} alt="" />
                                МЕНЮ
                            </a>
                        </div>
                    </div>
                </section>
            </section>
            <section className={styles.header_left}>
                <nav>
                    <a href="#">Напишите нам</a>
                    <a href="#">Акции</a>
                    <a href="#">Live</a>
                </nav>
                <div className={styles.socials}>
                    <img src={tg} alt="" />
                    <img src={youtube} alt="" />
                    <img src={vk} alt="" />
                </div>
            </section>
        </header>
    );
};
